import React, { useState, useCallback, useRef } from 'react';
import { GoogleMap, useLoadScript, Marker, InfoWindow } from '@react-google-maps/api';

const libraries = ["places"];
const mapContainerStyle = {
  width: '100%',
  height: '500px',
};
const center = {
  lat: 23.8103, // Default center (Dhaka, Bangladesh)
  lng: 90.4125,
};
const options = {
  disableDefaultUI: false,
  zoomControl: true,
};

const MapContainer = ({ onLocationSelect }) => {
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: "AIzaSyBh15L6ZQVrZVsMjwAhb_3-X6bbgpSGtQk", // Replace with your actual API key
    libraries,
  });

  const [markers, setMarkers] = useState([]);
  const [selected, setSelected] = useState(null);
  const [searchAddress, setSearchAddress] = useState("");
  const searchBoxRef = useRef(null);

  const onMapClick = useCallback((event) => {
    const newLocation = {
      lat: event.latLng.lat(),
      lng: event.latLng.lng(),
    };

    setMarkers([{
      lat: newLocation.lat,
      lng: newLocation.lng,
      time: new Date(),
    }]);

    if (onLocationSelect) {
      onLocationSelect(newLocation);
    }
  }, [onLocationSelect]);

  const handleSearchAddress = () => {
    if (searchAddress.trim() === "") return;

    const geocoder = new window.google.maps.Geocoder();
    geocoder.geocode({ address: searchAddress }, (results, status) => {
      if (status === "OK" && results[0]) {
        const { lat, lng } = results[0].geometry.location;
        const newLocation = {
          lat: lat(),
          lng: lng(),
        };

        setMarkers([{
          lat: newLocation.lat,
          lng: newLocation.lng,
          time: new Date(),
        }]);

        if (onLocationSelect) {
          onLocationSelect(newLocation);
        }
      } else {
        alert("Geocode was not successful for the following reason: " + status);
      }
    });
  };

  const handleMarkerDragEnd = (event) => {
    const newLocation = {
      lat: event.latLng.lat(),
      lng: event.latLng.lng(),
    };

    setMarkers([{
      lat: newLocation.lat,
      lng: newLocation.lng,
      time: new Date(),
    }]);

    if (onLocationSelect) {
      onLocationSelect(newLocation);
    }
  };

  if (loadError) return <div>Error loading maps</div>;
  if (!isLoaded) return <div>Loading Maps...</div>;

  return (
    <div>
      <div className="search-container" style={{ marginBottom: '10px' }}>
        <input
          type="text"
          placeholder="Search for a location"
          value={searchAddress}
          onChange={(e) => setSearchAddress(e.target.value)}
          ref={searchBoxRef}
          style={{ width: '70%', padding: '8px' }}
        />
        <button 
          onClick={handleSearchAddress}
          style={{ 
            padding: '8px 15px', 
            marginLeft: '10px', 
            backgroundColor: '#3498db', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Search
        </button>
      </div>

      <GoogleMap
        mapContainerStyle={mapContainerStyle}
        zoom={10}
        center={markers.length > 0 ? { lat: markers[0].lat, lng: markers[0].lng } : center}
        options={options}
        onClick={onMapClick}
      >
        {markers.map((marker) => (
          <Marker
            key={marker.time.toISOString()}
            position={{ lat: marker.lat, lng: marker.lng }}
            onClick={() => {
              setSelected(marker);
            }}
            draggable={true}
            onDragEnd={handleMarkerDragEnd}
          />
        ))}

        {selected ? (
          <InfoWindow
            position={{ lat: selected.lat, lng: selected.lng }}
            onCloseClick={() => {
              setSelected(null);
            }}
          >
            <div>
              <h2>Selected Location</h2>
              <p>Latitude: {selected.lat.toFixed(6)}</p>
              <p>Longitude: {selected.lng.toFixed(6)}</p>
            </div>
          </InfoWindow>
        ) : null}
      </GoogleMap>
    </div>
  );
};

export default MapContainer;
